/* This example requires Tailwind CSS v2.0+ */
import React from "react";


const navigation = [
  { name: 'Bio', href: '#', current: true },
  { name: 'Whats I was Made', href: '#', current: false },
]

export default function Example() {
  return (
    <div className=' flex justify-between bg-rose-600 w-full px-11'>
        <div>
            <a className='text-2xl uppercase font-semibold text-white'>logo</a>
        </div>
        <div className='flex-shrink-0'>
            <ul>
              <li className="text-white">Bio</li>
              <li className="text-white">What I was Made</li>
            </ul>
        </div>
    </div>
  );
}
